INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 401, "アヤネ", 2, 102301, 2, 0.0, "2030/12/17 14:59:59", 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 402, "アヤネ", 1, 102301, 2, 0.0, "2030/12/17 14:59:59", 2.21, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 403, "アヤネ", 2, 102301, 2, 0.0, "2030/12/17 14:59:59", 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 701, "アサヒ", 2, 192201, 1, 0.0, "2030/12/17 14:59:59", 1.99, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 702, "アサヒ", 1, 192201, 2, 0.0, "2030/12/17 14:59:59", 2.21, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 703, "アサヒ", 2, 192201, 1, 0.0, "2030/12/17 14:59:59", 3.33, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 801, "部員３", 2, 192301, 2, 0.0, "2030/12/17 14:59:59", 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 802, "部員３", 1, 192301, 2, 0.0, "2030/12/17 14:59:59", 2.68, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 803, "部員３", 2, 192301, 2, 0.0, "2030/12/17 14:59:59", 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 501, "", 1, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, "やった！", 24010);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 502, "", 1, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, "勝ったよ！", 24011);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 503, "", 1, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, "いい調子！", 24012);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 111, "ミサト", 6, 113501, 2, 0.0, "2030/12/17 14:59:59", 5.33, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 112, "ミサト", 1, 113501, 2, 0.0, "2030/12/17 14:59:59", 6.85, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 113, "ミサト", 1, 113501, 2, 0.0, "2030/12/17 14:59:59", 3.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 611, "ダイチ", 1, 192401, 2, 0.0, "2030/12/17 14:59:59", 6.11, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 612, "ダイチ", 1, 192401, 2, 0.0, "2030/12/17 14:59:59", 6.75, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 613, "ダイチ", 2, 192401, 2, 0.0, "2030/12/17 14:59:59", 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 211, "ハツネ", 2, 113401, 1, 0.0, "2030/12/17 14:59:59", 4.52, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 212, "ハツネ", 2, 113401, 1, 0.0, "2030/12/17 14:59:59", 3.89, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 213, "ハツネ", 1, 113401, 2, 0.0, "2030/12/17 14:59:59", 13.49, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 311, "カヤ", 1, 106501, 2, 0.0, "2030/12/17 14:59:59", 3.17, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 312, "カヤ", 1, 106501, 2, 0.0, "2030/12/17 14:59:59", 4.42, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 313, "カヤ", 6, 106501, 1, 0.0, "2030/12/17 14:59:59", 2.89, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 421, "アヤネ", 4, 102301, 3, 0.0, "2030/12/17 14:59:59", 3.71, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 721, "アサヒ", 2, 192201, 1, 0.0, "2030/12/17 14:59:59", 5.1, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 821, "部員３", 1, 192301, 3, 0.0, "2030/12/17 14:59:59", 4.34, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (0.0, "2020/07/31 12:00:00", 24, 10046, 521, "", 1, 192501, 1, 0.0, "2030/12/17 14:59:59", 0.0, "いい勝負だったよ\nまたやろうね", 24028);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "2020/07/31 12:00:00", 24, 10046, 101, "ミサト", 1, 113501, 2, 0.0, "2030/12/17 14:59:59", 5.62, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "2020/07/31 12:00:00", 24, 10046, 102, "ミサト", 1, 113501, 2, 0.0, "2030/12/17 14:59:59", 9.58, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "2020/07/31 12:00:00", 24, 10046, 103, "ミサト", 2, 113501, 2, 0.0, "2030/12/17 14:59:59", 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "2020/07/31 12:00:00", 24, 10046, 104, "ミサト", 2, 113501, 1, 0.0, "2030/12/17 14:59:59", 9.13, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032);
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (-360.0, "2020/07/31 12:00:00", 24, 10046, 105, "ミサト", 1, 113501, 2, 0.0, "2030/12/17 14:59:59", 8.27, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033);
